import React from "react";
import { DataGrid } from '@mui/x-data-grid';


const columns = [
    {field: "id", text: "ID", sort: true},
    {field: "name", text: "Name", sort: true, filter: textFilter()},
    {field: "username", text: "User Name", sort: true, filter: textFilter()},
    {field: "email", text: "Email"},
    {field: "phone", text: "Phone"},
    {field: "website", text: "Website"},
    {field: "address.city", text: "City", sort: true, filter: textFilter()},
    {field: "company.name", text: "Company", sort: true, filter: textFilter()},
    {field: "details", text: "Action"}
]

function TableMUI() {
    return(
        <div>
            <h2>Data Table</h2>
        </div>
    );
}

export default TableMUI;
